import React from 'react';
import {Grid} from '@material-ui/core';
import Product from './Product/Product';
import useStyles from './styles';

const products = [
    { id: 1, name: 'Shoes', description: 'Running shoes.', price: '$60', image: 'https://cdn.shopify.com/s/files/1/1104/4168/products/Allbirds_WL_RN_SF_PDP_Natural_Grey_BTY_10b4c383-7fc6-4b58-8b3f-6d05cef0369c_600x600.png?v=1610061677'},
    { id: 2, name: 'Macbook', description: 'Apple macbook.', price: '$1000', image: 'https://www.apple.com/newsroom/images/product/mac/standard/Apple-MacBook-Air-and-MacBook-Pro-update-wallpaper-screen-070919_big.jpg.large.jpg'},
];
const Products = () =>{
    const classes = useStyles();
    return (
        <main>
            <Grid container justify="center" spacing={4}>
                {products.map((product) => (
                <Grid item key={product.id} xs={12} sm={6} md={4} lg={3}>
                    <Product product={product}/>
                    </Grid>
                ))}

            </Grid>
        </main>
    );

}

export default Products;
